//https://leetcode.com/problems/minimum-moves-to-balance-circular-array
class Solution {
public:
    long long minMoves(vector<int>& balance) {
        long long index = -1;
        for(int i=0; i<balance.size(); i++){
            if(balance[i] < 0){
                index = i;
                break;
            }
        }
        if(index == -1)
            return 0;

        long long res = 0;
        long long iter = 1;
        while(balance[index] < 0 && iter < balance.size()){
            long long right = (index + iter)%balance.size();
            long long val = min(abs(balance[index]), balance[right]);
            balance[index] += val;
            balance[right] -= val;
            res += (1LL*iter*val);
            if(balance[index] >= 0)
                break;
            long long left = index - iter;
            if(left < 0){
                left = balance.size()+left;
            }
            val = min(abs(balance[index]), balance[left]);
            balance[index] += val;
            balance[left] -= val;
            res += (1LL*iter*val);
            iter++;
        }
        return balance[index] < 0? -1: res;
    }
};

